(window.webpackJsonp=window.webpackJsonp||[]).push([[204],{1077:function(n){n.exports={content:"<p>\u5f71\u54cd<code>Http</code>\u6027\u80fd\u7684\u51e0\u70b9\uff1a</p>\n<ol>\n<li>\n<p>TCP \u6162\u542f\u52a8</p>\n<p>\u6307\u7684\u662fTCP\u8fde\u63a5\u6700\u521d\u4f1a\u88ab\u9650\u5236\u8fde\u63a5\u6700\u5927\u901f\u5ea6\uff0c\u53ea\u6709\u5f53\u6570\u636e\u4f20\u9001\u6210\u529f\uff0c\u624d\u4f1a\u9010\u6b65\u63d0\u9ad8\u4f20\u8f93\u901f\u5ea6\uff0c\u8fd9\u662f\u4e3a\u4e86\u9632\u6b62\u56e0\u7279\u7f51\u7a81\u7136\u8fc7\u8f7d\u548c\u62e5\u585e\u3002</p>\n</li>\n<li>\n<p><code>Nagle</code>\u7b97\u6cd5</p>\n<p>\u5c06\u5927\u91cfTCP\u6570\u636e\u7ed1\u5b9a\u5728\u4e00\u8d77\uff0c\u907f\u514d\u5927\u91cf\u7684\u5c0f\u6570\u636e\u7684\u5206\u7ec4\u3002\u4f46\u95ee\u9898\u662f\uff0c\u53ef\u80fd\u56e0\u4e3a\u7b49\u5f85\u5176\u4ed6TCP\u6570\u636e\u4ea7\u751f\u5ef6\u8fdf\u3002</p>\n<p>\u5f00\u542f<code>TCP_NODELAY</code>\u9009\u9879\u53ef\u4ee5\u7981\u7528<code>Nagle</code>\u7b97\u6cd5\uff0c\u9700\u8981\u5c3d\u91cf\u786e\u4fdd\u53d1\u9001\u5927\u5757\u6570\u636e\u3002</p>\n</li>\n<li>\n<p>TIME_WAIT</p>\n<p>\u6307\u7684\u662f\u5728\u5173\u95edTCP\u8fde\u63a5\u65f6\uff0c\u4f1a\u6709\u4e00\u5c0f\u6bb5\u4fe1\u606f\u7f13\u5b58\u6700\u8fd1\u5173\u95ed\u7684IP\u5730\u5740\u548c\u7aef\u53e3\u53f7\uff0c\u7ef4\u6301<code>2MSL</code>\uff0c\u8fd9\u6bb5\u65f6\u95f4\u5185\u65e0\u6cd5\u521b\u5efa\u76f8\u540c\u7684IP\u5730\u5740\u548c\u7aef\u53e3\u53f7\u3002</p>\n<blockquote>\n<p>MSL\uff1aMaximum Segment Lifetime\uff0c\u89c4\u5b9a\u662f2\u5206\u949f\uff0c\u5b9e\u9645\u4e5f\u670930\u79d2\uff0c1\u5206\u949f\u3002</p>\n</blockquote>\n<p>\u4e4b\u6240\u4ee5\u7b49\u5f85<code>2MSL</code>\u662f\u4e3a\u4e86\u4fdd\u8bc1\u5ba2\u6237\u7aef\u53d1\u9001\u7684\u6700\u540e\u4e00\u4e2aACK\u62a5\u6587\u80fd\u591f\u5230\u8fbe\u670d\u52a1\u7aef\u3002</p>\n</li>\n<li>\n<p>\u4e32\u884c\u4e8b\u52a1\u5904\u7406</p>\n<p>\u5982\u679c\u6bcf\u4e2a\u4e8b\u52a1\u90fd\u9700\u8981\u5efa\u7acb\u4e00\u6761\u65b0\u7684\u94fe\u63a5\uff0c\u90a3\u4e48\u8fde\u63a5\u65f6\u5ef6\u548c\u6162\u542f\u52a8\u65f6\u5ef6\u5c31\u4f1a\u53e0\u52a0\u8d77\u6765\u3002</p>\n</li>\n</ol>\n<p>\u89e3\u51b3<code>Http</code>\u6027\u80fd\u7684\u51e0\u70b9\uff1a</p>\n<ol>\n<li>\n<p>\u5e76\u884c\u8fde\u63a5</p>\n<p>\u5ba2\u6237\u7aef\u6253\u5f00\u591a\u6761\u8fde\u63a5\uff0c\u5e76\u884c\u5730\u6267\u884c\u591a\u4e2aHTTP\u4e8b\u52a1\uff0c\u5145\u5206\u5229\u7528\u56e0\u7279\u7f51\u7684\u5e26\u5bbd\uff0c\u4f46\u8fd8\u662f\u53d7\u6162\u542f\u52a8\u5f71\u54cd\u3002</p>\n</li>\n<li>\n<p>\u6301\u4e45\u8fde\u63a5</p>\n<p>\u907f\u514d\u6162\u542f\u52a8\u9636\u6bb5\u548c\u91cd\u590d\u53d1\u9001\u62a5\u6587\u5934\u90e8\uff0c\u4f46\u8981\u6ce8\u610f\u907f\u514d\u7d2f\u79ef\u5927\u91cf\u7a7a\u95f2\u8fde\u63a5\u3002</p>\n<p><code>keep-alive</code>\u9996\u90e8\u53d1\u9001\u8bf7\u6c42\uff0c\u9700\u8981\u670d\u52a1\u5668\u8fd4\u56de<code>Connection:Keep-Alive</code>\u9996\u90e8\uff0c\u5426\u5219\u5ba2\u6237\u7aef\u8ba4\u4e3a\u670d\u52a1\u7aef\u4e0d\u652f\u6301<code>keep-alive</code>\u3002</p>\n<p>\u53c2\u6570<code>timeout</code>\uff0c\u4f30\u8ba1\u4e86\u670d\u52a1\u5668\u5e0c\u671b\u8fde\u63a5\u4fdd\u6301\u6d3b\u8dc3\u7684\u65f6\u95f4\uff0c\u5e76\u4e0d\u662f\u4e00\u4e2a\u627f\u8bfa\u503c\u3002</p>\n<p>\u53c2\u6570<code>max</code>\uff0c\u4f30\u8ba1\u4e86\u670d\u52a1\u5668\u5e0c\u671b\u4e3a\u591a\u5c11\u4e2a\u4e8b\u52a1\u4fdd\u6301\u8fde\u63a5\u6d3b\u8dc3\u72b6\u6001\uff0c\u5e76\u4e0d\u662f\u4e00\u4e2a\u627f\u8bfa\u503c\u3002</p>\n<p>http1.0 \u4f7f\u7528<code>connection:keep-alive</code>\u5f00\u542f\u6301\u4e45\u8fde\u63a5\u3002</p>\n<p>http1.1\u9ed8\u8ba4\u5f00\u542f\u6301\u4e45\u8fde\u63a5\uff0c\u540d\u4e3a<code>persistent connection</code>,\u5f53\u9700\u8981\u5173\u95ed\u65f6\uff0c\u53d1\u9001<code>connection:close</code>\u3002</p>\n</li>\n<li>\n<p>\u7ba1\u9053\u5316\u8fde\u63a5</p>\n<p>http1.1 \u5728\u6301\u4e45\u8fde\u63a5\u4e0a\u53ef\u9009\u62e9\u4f7f\u7528\u8bf7\u6c42\u7ba1\u9053\u3002</p>\n<p>\u4f7f\u7528\u7ba1\u9053\u5316\u80fd\u5728\u8bf7\u6c42\u7684\u540c\u65f6\uff0c\u7ee7\u7eed\u540e\u7eed\u7684\u8bf7\u6c42\uff0c\u63d0\u9ad8\u6027\u80fd\uff0c\u4f46\u4e0d\u5e94\u8be5\u4f7f\u7528\u6709\u526f\u4f5c\u7528\u7684\u8bf7\u6c42\u3002</p>\n</li>\n</ol>\n"}}}]);
